Kings Bounty: Warrior Cevera - the continuation of the cult adventure saga.
The game will take place in the already known world of Endor: in Darion, in dungeons dwarfs, and on lands the Vikings, where not to swim even the famous Bill Gilbert.Mighty Olaf, the son of King Nortlingov, dedicated war with the undead themselves, filling the northern lands of Endor. He will be freed from the frozen wastes of necromancers, dungeons and even the dwarves heart Endor - kingdom 
Darion. On the road to fame Olaf waiting treacherous enemies and new friends, fierce battles and adventures.


